import { GET_RESERVATION } from "./types";
import axios from "axios";
export const getReservation = (user) => async (dispatch) => {
  try {
    const res =
      user &&
      (await axios.get(
        `http://localhost:8000/chef-d'oeuvre/reservation/?user_id=${user}`
      ));

    console.log(res.data);
    dispatch({
      type: GET_RESERVATION,
      payload: res.data,
    });
  } catch (error) {
    console.log(error);
  }
};
